                <Cart />
                <SizeChart />
                <WaitingList />

                <Navbar />
                <Header />

                <PromoMessage />
                <Countdown />
                <Features />

                <Products />

                <LatestReviews />

                <Footer />
            </div>
        )
    }
}

//fetch what you want from the store
